import React from "react";
import { useParams } from 'react-router-dom';

import { ContainerPage, TittlePage } from "../../components/Main";

const NivelamentoPage = () => {
    // Obter o parâmetro 'dados' da URL
    const { dados } = useParams();

    // Decodificar os dados e exibi-los
    const dadosDecodificados = JSON.parse(decodeURIComponent(dados));

    return (
        <ContainerPage>
            <TittlePage>
                <div className="wc-text">Ótimo!<br /> Agora nos informe em que nível você se encontra em cada técnologia selecionada</div>
            </TittlePage>

            {/* Exibir os dados recebidos */}
            <div>
                <h1>Dados Nivelamento</h1>
                <p>Competências selecionadas: {dadosDecodificados.competencias.map(comp => comp.valor).join(', ')}</p>
                <p>Seleção do select: {dadosDecodificados.selectValue}</p>
            </div>
        </ContainerPage>
    );
}

export default NivelamentoPage;
